⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀⠀⠀
- Luanda Jones –
⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀⠀⠀⠀
Brazilian singer/songwriter @luandajones has been captivating audiences with her fluid vocals, touching lyricism and enveloping charm. With a style rooted in the suave, jazz-inflected and rhythmically traditional moods of leading Brazilian musical exports like João Gilberto and Gilberto Gil, she also adds more rambunctious sounds of funk and afrobeat to the mix.
⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀⠀⠀
Currently residing in Toronto, Luanda has had the pleasure of traveling across the globe, from London to Moscow, Paris to Madrid, where she’s had the honour of sharing stages with an ever-growing list of esteemed artists, including Guinga, Badi Assad and Hendrik Meurkens.
⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀⠀⠀
Sharing the stage with other great Toronto musicians, you’ll absolutely love the Brazilian jazz sounds of Luanda Jones on our JN Realty Studio Stage, on Sunday, September 13th at 4pm, as part of our 2020 World of Jazz Festival Virtual Concert.
⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀⠀⠀⠀⠀⠀⠀⠀ ⠀⠀⠀⠀
Watch the performance LIVE on worldofjazz.ca, or the World of Jazz Facebook and YouTube pages.
